create table france (
PRODUCT_DESC	VARCHAR2(250 Byte),
FORM_DESC	VARCHAR2(250 Byte),
DOSAGE	VARCHAR2(100 Byte),
DOSAGE_ADD	VARCHAR2(100 Byte),
VOLUME	VARCHAR2(100 Byte),
PACKSIZE	VARCHAR2(100 Byte),
CLAATC	VARCHAR2(100 Byte),
PFC	VARCHAR2(100 Byte),
MOLECULE	VARCHAR2(450 Byte),
CD_NFC_3	VARCHAR2(250 Byte),
ENGLISH	VARCHAR2(250 Byte),
LB_NFC_3	VARCHAR2(250 Byte),
DESCR_PCK	VARCHAR2(250 Byte),
STRG_UNIT	VARCHAR2(100 Byte),
STRG_MEAS	VARCHAR2(100 Byte)
)
;
WbImport -file=C:/mapping/France/FRDA.txt
         -type=text
         -table=FRANCE
         -encoding=Big5
         -header=true
         -decode=false
         -dateFormat="yyyy-MM-dd"
         -timestampFormat="yyyy-MM-dd HH:mm:ss"
         -delimiter='\t'
         -decimal=.
         -fileColumns=ROW_NUM,PRODUCT_DESC,FORM_DESC,DOSAGE,DOSAGE_ADD,VOLUME,PACKSIZE,CLAATC,PFC,MOLECULE,CD_NFC_3,ENGLISH,LB_NFC_3,DESCR_PCK,STRG_UNIT,STRG_MEAS
         -quoteCharEscaping=none
         -ignoreIdentityColumns=false
         -deleteTarget=true
         -continueOnError=false;
--delete duplicate values from source table 
--create rank to definge wich concept to remove
create table france_rank as 
(
(select  ROW_NUM,PRODUCT_DESC,FORM_DESC,DOSAGE,DOSAGE_ADD,VOLUME,PACKSIZE,CLAATC,PFC,MOLECULE,CD_NFC_3,ENGLISH,LB_NFC_3,DESCR_PCK,STRG_UNIT,STRG_MEAS, 
RANK() OVER (PARTITION BY PFC ORDER BY PRODUCT_DESC, CLAATC, FORM_DESC, VOLUME, dosage) as rank1
FROM (SELECT * FROM FRANCE WHERE PFC IN (SELECT PFC FROM FRANCE GROUP BY PFC HAVING COUNT (1) >1)
)))
;
delete from france a where exists (select 1 from france_rank b where a.PRODUCT_DESC = b.PRODUCT_DESC and
a.CLAATC=  b.CLAATC and
a.FORM_DESC= b.FORM_DESC and
a.VOLUME= b.VOLUME and
a.dosage = b.dosage 
and b.rank1 >1)
;
--creating manual tables
--translation of forms to English
create table france_names_translation (DOSE_FORM	VARCHAR2(300 Byte)	,DOSE_FORM_NAME	VARCHAR2(300 Byte)	);

--creation of ingredients mapping where precedence = 1, so mapping is 1 to 1
create table INGR_NEED_TO_MAP_DONE(CONCEPT_NAME	VARCHAR2(300 Byte),CONCEPT_ID_2	VARCHAR2(300 Byte));

create table BRAND_NEED_TO_MAP_DONE(SOURCENAME	VARCHAR2(300 Byte),CONCEPT_ID	NUMBER	,CONCEPT_NAME	VARCHAR2(300 Byte));

create table new_form_name_mapping(DOSE_FORM_NAME	VARCHAR2(250 Byte)	,CONCEPT_ID_2	NUMBER	,PRECEDENCE	NUMBER	,CONCEPT_NAME	VARCHAR2(250 Byte));

create table add_ingr (SOURCE_NAME	VARCHAR2(250 Byte),CONCEPT_ID	NUMBER	,TARGET_NAME	VARCHAR2(250 Byte),PRECEDENCE	NUMBER);

commit
;
